import React from 'react';
import {BrowserRouter, Switch , Route} from 'react-router-dom';
import Home from './views/Home/Home';
import Footer from './components/Footer/Footer'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
         <Switch>
              <Route path="/" exact component={Home}/>  
              <Footer/>
         </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
